import { createRouter, createWebHistory } from 'vue-router';
import CadastroAluno from '../view/alunos/CadastroAluno.vue';
import EditarAluno from '../view/alunos/EditarAluno.vue';
import ListaAlunos from '../view/alunos/ListaAlunos.vue';
import CadastroProfessor from '../view/professores/CadastroProfessor.vue';
import EditarProfessor from '../view/professores/EditarProfessor.vue';
import ListaProfessores from '../view/professores/ListaProfessores.vue';
import CadastroVisitante from '../view/visitantes/CadastroVisitante.vue';
import EditarVisitante from '../view/visitantes/EditarVisitante.vue';
import ListaVisitantes from '../view/visitantes/ListaVisitantes.vue';
import CadastroGrupo from '../view/grupos/CadastroGrupo.vue';
import EditarGrupo from '../view/grupos/EditarGrupo.vue';
import ListaGrupos from '../view/grupos/ListaGrupos.vue';
import CadastroCurso from '../view/cursos/CadastroCurso.vue';
import EditarCurso from '../view/cursos/EditarCurso.vue';
import ListaCursos from '../view/cursos/ListaCursos.vue';
import CadastroAvaliador from '../view/avaliadores/CadastroAvaliador.vue';
import EditarAvaliador from '../view/avaliadores/EditarAvaliador.vue';
import ListaAvaliadores from '../view/avaliadores/ListaAvaliadores.vue';

const routes = [
  {
    path: '/alunos',
    name: 'ListaAlunos',
    component: ListaAlunos,
  },
  {
    path: '/alunos/cadastrar',
    name: 'CadastroAluno',
    component: CadastroAluno,
  },
  {
    path: '/alunos/editar/:id',
    name: 'EditarAluno',
    component: EditarAluno,
    props: true,
  },
  {
    path: '/professores',
    name: 'ListaProfessores',
    component: ListaProfessores,
  },
  {
    path: '/professores/cadastrar',
    name: 'CadastroProfessor',
    component: CadastroProfessor,
  },
  {
    path: '/professores/editar/:id',
    name: 'EditarProfessor',
    component: EditarProfessor,
    props: true,
  },
  {
    path: '/visitantes',
    name: 'ListaVisitantes',
    component: ListaVisitantes,
  },
  {
    path: '/visitantes/cadastrar',
    name: 'CadastroVisitante',
    component: CadastroVisitante,
  },
  {
    path: '/visitantes/editar/:id',
    name: 'EditarVisitante',
    component: EditarVisitante,
    props: true,
  },
  {
    path: '/grupos',
    name: 'ListaGrupos',
    component: ListaGrupos,
  },
  {
    path: '/grupos/cadastrar',
    name: 'CadastroGrupo',
    component: CadastroGrupo,
  },
  {
    path: '/grupos/editar/:id',
    name: 'EditarGrupo',
    component: EditarGrupo,
    props: true,
  },
  {
    path: '/cursos',
    name: 'ListaCursos',
    component: ListaCursos,
  },
  {
    path: '/cursos/cadastrar',
    name: 'CadastroCurso',
    component: CadastroCurso,
  },
  {
    path: '/cursos/editar/:id',
    name: 'EditarCurso',
    component: EditarCurso,
    props: true,
  },
  {
    path: '/avaliadores',
    name: 'ListaAvaliadores',
    component: ListaAvaliadores,
  },
  {
    path: '/avaliadores/cadastrar',
    name: 'CadastroAvaliador',
    component: CadastroAvaliador,
  },
  {
    path: '/avaliadores/editar/:id',
    name: 'EditarAvaliador',
    component: EditarAvaliador,
    props: true,
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
